import React,{useState,useEffect} from "react";
import Table from "./table";

function App(){
    const [data, setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3000/transactions")
        .then(resp=>resp.json())
        .then(info=>setData(info))
    },[])
    return(
        <div>
            <Table transactions={data}/>
        </div>
    )
}

export default App
